import React, { useEffect, useState } from 'react'

function GymClass() {

    const [title, setTitle] =useState("")
    const [time , setTime] =useState("")
    const [gymclass, setGymclass]= useState([])


    const new_gymclass={title, time}

    const getClassImage = (title) => {
      const images = {
        "Morning yoga": "data:image/jpeg;base64,",
        "Hit blast": "data:image/jpeg;base64,",
        "Evening walk": "data:image/jpeg;base64,",
        "Pilates": "data:image/jpeg;base64,",
        "Strength Training": "data:image/jpeg;base64,",
        "Zumba":"data:image/jpeg;base64,",
        "Boxing Basics": "data:image/jpeg;base64,",
        "Spin Class": "data:image/jpeg;base64,",
        "Core Crusher": "data:image/jpeg;base64,",
        "Mobility Flow": "data:image/jpeg;base64,",
        "Full Body Bootcamp": "https://images.unsplash.com/photo-1624561172888-ac93c696e10c",
      };
      return images[title] || "https://images.unsplash.com/photo-1571019613454-1cb2f99b2d8b"; // fallback
    };
    

    
    useEffect(()=>{
        fetch('/gymclass', {
            credentials:"include"
        })
        .then(res=> res.json())
        .then(data=>{
            setGymclass(data)
        })
    },[])

    function handleSubmit() {
        fetch('/gymclass', {
            method: 'POST',
            headers: {
                'Content-Type':"application/json"
            },
            body:JSON.stringify(new_gymclass)
        })
        .then(res=>res.json())
        .then(data=> {
            console.log(data)
            setTitle('')
            setTime('')
            setGymclass([gymclass, data])
        })
        .catch(err=> console.error("Failed to load Gymclasses:",err))
    }




    return (
      <div style={{
        maxWidth: "1500px",
        margin: "auto",
        padding: "90px",
        fontFamily: '"Segoe UI", Tahoma, Geneva, Verdana, sans-serif',
        backgroundColor: "#000",
        color: "white",
        minHeight: "100vh"
      }}>
        <h2 style={{ textAlign: "center", marginBottom: "30px", color: "#fff" }}>
          Available Gym Classes
        </h2>
  
        <div style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(280px, 1fr))",
          gap: "20px",
          backgroundColor:"black"
        }}>
          {gymclass.map((gymclass) => (
            <div key={gymclass.id} style={{
              backgroundColor: "#1a1a1a",
              borderRadius: "9px",
              padding: "20px",
              boxShadow: "0 4px 12px rgba(255,255,255,0.05)",
              transition: "transform 0.2s ease-in-out",
              color: "#eee"
            }}>
              <img
                src={getClassImage(gymclass.title)}
                alt={gymclass.title}
                style={{
                  width: "100%",
                  height: "150px",
                  objectFit: "cover",
                  borderRadius: "8px",
                  borderColor:"black",
                  marginBottom: "15px"
                }}
              />
              <h1 style={{ margin: "0 0 10px", color: "#f0f0f0" }}>{gymclass.title}</h1>
              <p style={{ color: "#aaa" }}>{gymclass.time}</p>
              <button
                onClick={() => handleSubmit(gymclass.id)}
                style={{
                  marginTop: "15px",
                  backgroundColor: "#28a745",
                  color: "white",
                  border: "none",
                  padding: "10px 15px",
                  borderRadius: "6px",
                  cursor: "pointer",
                  fontWeight: "bold"
                }}
              >
                Book Class
              </button>
            </div>
          ))}
        </div>
      </div>
    );
  }
  
  export default GymClass;